According to Wikipedia:

&quot;SolidWorks is a program of computer-aided design for mechanical modeling currently developed by SolidWorks Corp., a subsidiary of Dassault Systemes (Suresnes, France) for the Microsoft Windows operating system.'s A parametric solid modeler. Was introduced in the market in 1995 to compete with other CAD programs such as Pro / ENGINEER, NX, Solid Edge, CATIA, Mechanical Desktop yAutodesk.
The program allows modeling parts and assemblies and to extract both flat and other information necessary for production. It is a program that works using new techniques for modeling with CAD systems. The transfer process is the mental idea Designer CAD system, &quot;building virtually&quot; the part or assembly. Subsequently all withdrawals (drawings and swap files) are done fairly automated. &quot;
